import React, { useState } from "react";

import "./SearchPost.css";

const onClickToggle = (e) => {
  e.preventDefault();
};

const SearchPost = (props) => {
  return (
    <div
      className="searchPostContainer"
      style={{ display: props.searchToggle }}
    >
      <button className="searchOffBtn" onClick={onClickToggle}>
        닫기
      </button>
      <input type="text" />
      <div>입력 후 엔터를 눌러주세요</div>
    </div>
  );
};

export default SearchPost;
